import {
 Box,
  CardContent,
} from "@mui/material";

import TextField from "@mui/material/TextField";

import * as React from "react";


export const CreateIntegration = (props) => (
  <CardContent>
    <Box
      component="form"
      sx={{
        "& .MuiTextField-root": { m: 1, width: "25ch" },
      }}
      noValidate
      autoComplete="off"
    >
      <TextField
        required
        id="outlined-required"
        label="Registradora"
        multiline
        maxRows={4}
      />
    </Box>
  </CardContent>
);
